import React from 'react'
import ReactDOM from 'react-dom'
import PropTypes from 'prop-types'
import './index.css'
import 'font-awesome/css/font-awesome.min.css';

function ThreadListItem({title, items}) {
    return (
        <div className="thread_list_item">
            <div className="title">{title}</div>
            <ul>

            </ul>
        </div>
    )
}

function Headline ( {id, title, url} ) {
    return (
        <div className="headline">
            <div className="id">1</div> 
            <div className="title" /> 

        </div>
    )

}

function Data ({}) {

}

function ThreadList ( {files} ) {
    return (
        <table className="list_of_threads">
            <tbody>
                {files.map ( file => (
                    <tr className="thread-list-item" key={file.id}> 
                        <td className="thread-list-title"> {file.title} </td>
                        <td className="thread-list-title"> {file.title} </td>

                    </tr>
                ))}
            </tbody>
        </table>
    )
}



ThreadList.propTypes = {
    files: PropTypes.array
}


const testCards = [ 
    {
        id: 1,
        title: `Why I'm Suing the US government`,
        url: 'bunniestudios',
        points: '1346',
        by: 'ivank',
        time: '11',
        comments: '257'
    },
    {
        id: 2,
        title: `Zenzizen`,
        url: 'wikipedia.org',
        points: '140',
        by: 'vinchuco',
        time: '4',
        comments: '40'
    },
];



ReactDOM.render( 
    <ThreadList files={testCards}/>, 
    document.querySelector('#root')
)
